import{_ as e,o as t,c as o,O as a}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 64.2-201 Distribution of personal estate; right of Commonwealth if no other distributee.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/64.2-201.md","filePath":"vacode/64.2-201.md"}'),r={name:"vacode/64.2-201.md"},s=a('<h1 id="§-64-2-201-distribution-of-personal-estate-right-of-commonwealth-if-no-other-distributee" tabindex="-1">§ 64.2-201 Distribution of personal estate; right of Commonwealth if no other distributee. <a class="header-anchor" href="#§-64-2-201-distribution-of-personal-estate-right-of-commonwealth-if-no-other-distributee" aria-label="Permalink to &quot;§ 64.2-201 Distribution of personal estate; right of Commonwealth if no other distributee.&quot;">​</a></h1><p>A. The surplus of the personal estate or any part thereof of any decedent, after payment of funeral expenses, charges of administration, and debts, and subject to the provisions of Article 2 (§ <a href="http://law.lis.virginia.gov/vacode/64.2-309/" target="_blank" rel="noreferrer">64.2-309</a> et seq.) of Chapter 3, not effectively disposed of by will passes by intestate succession and is distributed to the same persons, and in the same proportions, as real estate descends pursuant to § <a href="http://law.lis.virginia.gov/vacode/64.2-200/" target="_blank" rel="noreferrer">64.2-200</a>.</p><p>B. If there is no other distributee of a decedent&#39;s personal estate, such personal estate shall accrue to the Commonwealth.</p><p>Code 1950, §§ 64-11, 64-12; 1968, c. 656, §§ 64.1-11, 64.1-12; 1978, c. 647; 1981, c. 580; 1982, c. 304; 1983, c. 320; 2012, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?121+ful+CHAP0614" target="_blank" rel="noreferrer">614</a>.</p>',4),i=[s];function n(l,c,d,h,f,p){return t(),o("div",null,i)}const m=e(r,[["render",n]]);export{u as __pageData,m as default};
